import Axios from "axios";
import { useEffect, useState } from "react";


function App(){
  const [catFact, setCatFact] = useState("");
  useEffect(()=>{

    Axios.get("https://catfact.ninja/fact").then((res)=>{
    setCatFact(res.data.fact);
  });


}, []);


   return (
    <div className='App'>
      <button> Generate Cat Fact </button>
      <p> {catFact}</p>
    </div>
   );
}

export default App;
